  remarks: "IisTraceListener 類別連接的追蹤機制[!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)]至[!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]。 這個接聽程式的類別可讓開發人員建立[!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)]應用程式和人員實作<xref:System.Web.IHttpModule>和<xref:System.Web.IHttpHandler>介面來引發頁面層級、 模組層級或處理常式層級的事件，以[!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]會啟用追蹤時的基礎結構。</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      > [!NOTE] > 這個接聽程式的類別不會路由[!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]ASP.NET 類別的事件。 這包括<xref:System.Web.UI.Page>類別和類別可實作<xref:System.Web.IHttpModule>或<xref:System.Web.IHttpHandler>介面。</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       中導入 IisTraceListener [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]。 如需詳細資訊，請參閱[版本和相依性](~/add/includes/ajax-current-ext-md.md)。"
